{
  "translationLines": [
    {
      "lineNumber": 29491,
      "originalJapaneseLine": "「ん……こんなところ、かな……」",
      "translatedEnglishLine": "\"Hmm... is it somewhere like this...?\""
    },
    {
      "lineNumber": 29492,
      "originalJapaneseLine": "「できたかー？」",
      "translatedEnglishLine": "\"Is it done?\""
    },
    {
      "lineNumber": 29493,
      "originalJapaneseLine": "「はい、ランス様。三人選べました」",
      "translatedEnglishLine": "\"Yes, Lord Rance. I managed to select three.\""
    },
    {
      "lineNumber": 29494,
      "originalJapaneseLine": "「三人？　こんだけいて、条件に見合うのが",
      "translatedEnglishLine": "\"Three? Out of all these, only three meet the conditions"
    },
    {
      "lineNumber": 29495,
      "originalJapaneseLine": "　たった三人ぼっちか」",
      "translatedEnglishLine": "— only three alone?\""
    },
    {
      "lineNumber": 29496,
      "originalJapaneseLine": "「ランス様の条件、厳しいです……」",
      "translatedEnglishLine": "\"Lord Rance's conditions are strict...\""
    },
    {
      "lineNumber": 29497,
      "originalJapaneseLine": "「ふん、まあいい。",
      "translatedEnglishLine": "\"Hmph, well, fine."
    },
    {
      "lineNumber": 29498,
      "originalJapaneseLine": "　この三人をさっそく呼べ！」",
      "translatedEnglishLine": "Call these three at once!\""
    },
    {
      "lineNumber": 29499,
      "originalJapaneseLine": "「お……」",
      "translatedEnglishLine": "\"Oh...\""
    },
    {
      "lineNumber": 29500,
      "originalJapaneseLine": "ランスが中庭をうろついていると、",
      "translatedEnglishLine": "While Rance was wandering around the courtyard,"
    },
    {
      "lineNumber": 29501,
      "originalJapaneseLine": "ひときわ目立つ大きなものが、立ち尽くしていた。",
      "translatedEnglishLine": "a particularly large figure stood still, standing out."
    },
    {
      "lineNumber": 29502,
      "originalJapaneseLine": "「……城主殿か」",
      "translatedEnglishLine": "\"...Is that the lord of the castle?\""
    },
    {
      "lineNumber": 29503,
      "originalJapaneseLine": "「おうロボ野郎。…………何やってるんだ？」",
      "translatedEnglishLine": "\"Hey, robo guy. ...What are you doing?\""
    },
    {
      "lineNumber": 29504,
      "originalJapaneseLine": "「……何もしない、ように腐心しているところだ」",
      "translatedEnglishLine": "\"...I'm struggling to do nothing.\""
    },
    {
      "lineNumber": 29505,
      "originalJapaneseLine": "「うっ、うっ……♪」",
      "translatedEnglishLine": "\"Ugh, ugh...♪\""
    },
    {
      "lineNumber": 29506,
      "originalJapaneseLine": "「がははー！」",
      "translatedEnglishLine": "\"Gahaha!\""
    },
    {
      "lineNumber": 29507,
      "originalJapaneseLine": "見れば、リセットとキバ子が遊具か何かのように",
      "translatedEnglishLine": "Looking closely, Reset and Kibako were clinging on like playground equipment or something,"
    },
    {
      "lineNumber": 29508,
      "originalJapaneseLine": "纏わりつき、ゼータのあちこちにぶら下がっていた。",
      "translatedEnglishLine": "wrapping around and hanging here and there on Zeta."
    },
    {
      "lineNumber": 29509,
      "originalJapaneseLine": "「何やってんだホントに……",
      "translatedEnglishLine": "\"What the hell are you doing, really...?"
    },
    {
      "lineNumber": 29510,
      "originalJapaneseLine": "　ビスケッタさんに言って引っぺがさせるか」",
      "translatedEnglishLine": "Should I tell Biscetta and have her peel them off?\""
    },
    {
      "lineNumber": 29511,
      "originalJapaneseLine": "「いや……修正は必要ない。",
      "translatedEnglishLine": "\"No... no corrections needed."
    },
    {
      "lineNumber": 29512,
      "originalJapaneseLine": "　安全面は、私が気を配っておく」",
      "translatedEnglishLine": "I will take care of the safety aspects.\""
    },
    {
      "lineNumber": 29513,
      "originalJapaneseLine": "「ふーん？　まあいいが。",
      "translatedEnglishLine": "\"Hmm? Well, fine."
    },
    {
      "lineNumber": 29514,
      "originalJapaneseLine": "　ただのでかいオブジェやってないで、",
      "translatedEnglishLine": "Don't just act as a big object,"
    },
    {
      "lineNumber": 29515,
      "originalJapaneseLine": "　きちんと働けよ」",
      "translatedEnglishLine": "work properly.\""
    },
    {
      "lineNumber": 29516,
      "originalJapaneseLine": "「神経回路の拡張は進行中だ。",
      "translatedEnglishLine": "\"The neural circuit expansion is in progress."
    },
    {
      "lineNumber": 29517,
      "originalJapaneseLine": "　いずれこの闘神都市……いやランス城、だったか。",
      "translatedEnglishLine": "Someday, this Fighting God City... no, Rance Castle, was it?"
    },
    {
      "lineNumber": 29518,
      "originalJapaneseLine": "　この城と同化できるだろう」",
      "translatedEnglishLine": "I will be able to merge with this castle.\""
    },
    {
      "lineNumber": 29519,
      "originalJapaneseLine": "「俺様の城なのに……",
      "translatedEnglishLine": "\"Even though it's my castle..."
    },
    {
      "lineNumber": 29520,
      "originalJapaneseLine": "　なんか闘神に乗っ取られてると思うと",
      "translatedEnglishLine": "Somehow thinking it's been taken over by the Fighting God"
    },
    {
      "lineNumber": 29521,
      "originalJapaneseLine": "　落ち着かんな……」",
      "translatedEnglishLine": "makes me uneasy...\""
    },
    {
      "lineNumber": 29522,
      "originalJapaneseLine": "「同化が完了した暁には、",
      "translatedEnglishLine": "\"When the assimilation is complete,"
    },
    {
      "lineNumber": 29523,
      "originalJapaneseLine": "　戦闘用、防衛用ほか、様々な施設が作れる。",
      "translatedEnglishLine": "we'll be able to build various facilities, for battle, defense, and more."
    },
    {
      "lineNumber": 29524,
      "originalJapaneseLine": "　有為なはずだ」",
      "translatedEnglishLine": "It should be useful.\""
    },
    {
      "lineNumber": 29525,
      "originalJapaneseLine": "「ほう。",
      "translatedEnglishLine": "\"Oh."
    },
    {
      "lineNumber": 29526,
      "originalJapaneseLine": "　じゃあその調子で飛べるようになったり？」",
      "translatedEnglishLine": "So, can you manage to fly with that?\""
    },
    {
      "lineNumber": 29527,
      "originalJapaneseLine": "「それは難しいな……すまない。",
      "translatedEnglishLine": "\"That's difficult... I'm afraid not."
    },
    {
      "lineNumber": 29528,
      "originalJapaneseLine": "　飛行ユニットのシステム面の問題で、",
      "translatedEnglishLine": "Because of problems with the flight unit's system,"
    },
    {
      "lineNumber": 29529,
      "originalJapaneseLine": "　私では直せない」",
      "translatedEnglishLine": "I can't fix it.\""
    },
    {
      "lineNumber": 29530,
      "originalJapaneseLine": "「ちっ、役に立たん。",
      "translatedEnglishLine": "\"Tch, useless."
    },
    {
      "lineNumber": 29531,
      "originalJapaneseLine": "　闘神ってのは強い堅いばっかだな」",
      "translatedEnglishLine": "Fighting Gods are just strong and tough, huh.\""
    },
    {
      "lineNumber": 29532,
      "originalJapaneseLine": "「……質問しても構わないだろうか」",
      "translatedEnglishLine": "\"...May I ask you a question?\""
    },
    {
      "lineNumber": 29533,
      "originalJapaneseLine": "「あん？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 29534,
      "originalJapaneseLine": "「城主殿は闘神に含む所があるのか。",
      "translatedEnglishLine": "\"Does the lord of the castle share something in common with the Fighting Gods?"
    },
    {
      "lineNumber": 29535,
      "originalJapaneseLine": "　今の時代の人間には、",
      "translatedEnglishLine": "To people of this age,"
    },
    {
      "lineNumber": 29536,
      "originalJapaneseLine": "　聖魔教団の遺産はただの遺物のはず……」",
      "translatedEnglishLine": "the legacy of the Holy Demon Cult should just be relics...\""
    },
    {
      "lineNumber": 29537,
      "originalJapaneseLine": "「ああ、別に大したことじゃない。",
      "translatedEnglishLine": "\"Ah, it's nothing special."
    },
    {
      "lineNumber": 29538,
      "originalJapaneseLine": "　前に何度か襲われて苦労させられたってだけだ。",
      "translatedEnglishLine": "I was just troubled because they attacked me a few times before."
    },
    {
      "lineNumber": 29539,
      "originalJapaneseLine": "　ま、全部ブッ潰してやったがな」",
      "translatedEnglishLine": "Well, I smashed them all, though.\""
    },
    {
      "lineNumber": 29540,
      "originalJapaneseLine": "「…………人間がか？」",
      "translatedEnglishLine": "\"...Were they humans?\""
    }
  ]
}

